  @spec solve(heights :: [integer]) :: integer
  def solve(heights) do
    do_solve(heights)
  end

  defp do_solve([]), do: 0
  defp do_solve([h]), do: h
  defp do_solve(heights) do
    if Enum.uniq(heights) |> Enum.count == 1 do
      Enum.count(heights) * Enum.at(heights, 0)
    else
      min = Enum.min(heights)

      {left, right} = split(heights, min, [])

      Enum.max([min * Enum.count(heights), do_solve(left), do_solve(right)])
    end
  end

  defp split([h | t], char, left) when char == h, do: {Enum.reverse(left), t}
  defp split([h | t], char, left) do
    split(t, char, [h | left])
  end
end
